Hilary Erhard Duff (born September 28, 1987) is an American actress and singer.

Duff gained fame for playing the title role in the Disney Channel television series &quot;Lizzie McGuire&quot;.

She subsequently ventured into motion pictures and has many successful films to her credit including The Lizzie McGuire Movie, Cheaper by the Dozen, A Cinderella Story and Cheaper by the Dozen 2. She has most recently appeared in According to Greta and Stay Cool. As of December 2010, her upcoming films include, Bloodworth, The Story of Bonnie and Clyde and She Wants Me.

Duff has since expanded her repertoire into pop music with the release of three RIAA-certified platinum albums: Metamorphosis, her debut studio album, was certified triple platinum and was supplemented by a further two platinum albums, Hilary Duff and Most Wanted. In 2007, she released her third studio album, Dignity, which was certified gold later than year[1] and spawned singles &quot;With Love&quot; ÃƒÂ¢Ã¢â€šÂ¬Ã¢â‚¬ï¿½ her highest charting US single to date ÃƒÂ¢Ã¢â€šÂ¬Ã¢â‚¬ï¿½ and &quot;Stranger&quot;.

